import React from "react";
import "../instructions/instruction.css";

const instruction = () => {
    return(
        <div className="Instruction">
            <h2>
                This Will be the header for instructions.
            </h2>
            <p>
                This will be the instructions.
            </p>
        </div>
    )
}

export default instruction;
